import React from 'react';

const CommentCard = ({comment}) => {
  console.log(comment)
  return (
    <div>
      <li>
      <h3>
        {console.log(comment.author)}
          posted by: {comment.author}
        </h3>
        <h4>
            votes: {comment.votes}
           <p>{comment.body}</p>
        </h4>
        <h5>

          published at: {comment.created_at}
        </h5>

      </li>
    </div>
  );
};

export default CommentCard;
